There is always a mission on your mind; There is always an enemy in your 
view; 
There is always responsibility on your shoulders; There is always passion 
in your heart; 
War could erupt any time; Are you ready? [...]
Even if a bullet passes through my chest; My mission remains carved in my 
heart; 
Brothers, let’s follow this light; [Roar! Roar! Roar! Roar!] 
Roar with animal spirit; Look to the bravest general of them all; 
Walk from here toward the site of combat; Even if a bullet passes through 
my chest; 
My mission remains carved in my heart; From the centre to the borders; 
Let’s go to war, let’s fight to win; 
When we follow the commands of the party; The country honours our 
guardianship;
 The rising head of a loyal patriot; If I don’t bear the burden, who else 
will?
